
export class STT {
    constructor(fields) {
        
        Object.defineProperty(this, "endpoint", {
            enumerable: true,
            configurable: true,
            writable: true,
            value: process.env.STT_URL
        });
        
        this.endpoint = fields?.endpoint ?? this.endpoint;

    }
    async transcribe(
        audioData,
        sampleRate
    ) {
        const jsonBody = {
            audio_data: audioData,
            sample_rate: sampleRate
        };
  
        const response = await fetch(this.endpoint, {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json'
          },
          body: JSON.stringify(jsonBody)
        });

        if (!response.ok) {
            throw new Error(`Failed to get transcription: ${response.status}`);
        }
  
        const data = await response.json();
        
        return [data.transcription, data.language];
    }

    async isReady() {
        try {
            const response = await fetch(process.env.STATUS_URL);

            if (!response.ok) {
                throw new Error("Failed to get STT status.")
            }

            const data = await response.json();
            
            return data.stt;

        } catch (error) {
            console.log("Error checking STT status: ", error);
            return false;
        }
    }
}

